import Contact from "./component/Contact"
import Menu from "./component/Menu"

function App() {
  const [openNav, setOpenNav] = useState(false);
  return (
    <div className="app">
      <Topbar />
      <Menu />
      <div className="sections">
        <Intro />
        <Work />
        <Testimonials />
        <Contact />
      </div>
    </div>
  );
}

export default App;
